import React, {useState, useEffect} from 'react';
import {
  SafeAreaView,
  ScrollView,
  StatusBar,
  StyleSheet,
  Text,
  useColorScheme,
  View,
} from 'react-native';
import PickerPage from './Pages/PickerPage';
import StartPage from './Pages/StartPage';
import { NavigationContainer } from '@react-navigation/native';

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
      <Stack.Screen
        name="StartPage"
        component={StartPage} />
      <Stack.Screen name="PickerPage" component={PickerPage} />
  </Stack.Navigator>
        case 0: return (<StartPage setScreen={setScreen} />);
        case 1: return (<PickerPage setScreen={setScreen} />);
    </NavigationContainer>
  );
};

export default App;
